import React from 'react';
import './styles.scss';

import noGif from '../../assets/no.gif';
import goGif from '../../assets/go.gif';

function RSVP() {
  return (
    <div className="rsvp-wrapper">
      <div className="no-wrapper half">
        <span className="no">
          <img src={noGif} />
          <span className="">No :/</span>
        </span>
      </div>

      <div className="go-wrapper half">
        <span className="go">
          <img src={goGif} />
          Go :}
        </span>
      </div>
    </div>
  );
}

export default RSVP;
